import logo from './logo.svg';
import './App.css';

import axios from 'axios';
import { useState } from 'react';


function App() {

  const [details,setDetails] = useState(null)

  let fetchData = axios.get('http://localhost:8000').then((response)=>{
    setDetails(response.data)
  })

  return (
    <div className="App">
      <h1>Hello world</h1>
      {
         details.map((value,idx)=>{
          return (

            <h2>{value.name}, {value.department}</h2>
          )
        })
      }
    </div>
  );
}

export default App;
